    /**
     * Get featureSigns that are common to a list of symbol names
     * @param symbolNames   The symbols names that we want to find common featureSigns for
     * @return  A list of featureSigns that match the symbols
     */
    public List<FeatureSign> getFeatureSignsFromSymbols(List<String> symbolNames) {
        // The grand list of feature signs to return
        List<FeatureSign> featureSigns = new ArrayList<>();
        // For each of the specified features
        for(int i = 0; i < symbolNames.size(); i++) {
            // Create a list
            List<FeatureSign> currentFeatureSigns = new ArrayList<>();
            // Get the symbol sign
            Symbol current = getSymbolByName( symbolNames.get(i) );
            // For all of the feature sign symbols
            for(int j = 0; j < featureSignSymbols.size(); j++) {
                // Get the current feature sign symbol
                FeatureSignSymbol featureSignSymbol = featureSignSymbols.get(j);
                // This feature sign symbol matches one of the symbols we are looking for
                if(featureSignSymbol.getSymbol().equals(current)) {
                    // If i is 0, just add it to the result
                    if(i == 0) {
                        currentFeatureSigns.add(featureSignSymbol.getFeatureSign());
                    }
                    // Otherwise, if the previous list of feature signs has this feature sign
                    // include it in the result (this is essentially getting the intersection
                    // between the previous list of symbols and the current list)
                    // We only include it if it would be in the intersection
                    else if(featureSigns.contains(featureSignSymbol.getFeatureSign())) {
                        currentFeatureSigns.add(featureSignSymbol.getFeatureSign());
                    }
                }
            }
            featureSigns = currentFeatureSigns;
            // For a performance boost, break if there are no feature signs since there will not ever be
            if(featureSigns.size() == 0) {
                break;
            }
        }

        return featureSigns;
    }

    /**
     * Get Symbols that are common to a list of featureSigns.
     * @param featureNames  A list of features to find common symbols for
     * @param signs A list of signs corresponding to the features - i.e. the ith feature in the
     *              list of features has a sign of the ith item in this list. Thus, featuresigns are
     *              created
     * @return  A list of matching symbols
     */
    public List<Symbol> getSymbolsFromFeatureSigns(List<String> featureNames, List<Boolean> signs) {
        // The grand list of symbols to return
        List<Symbol> symbols = new ArrayList<>();
        // For each of the specified features
        for(int i = 0; i < featureNames.size(); i++) {
            // Create a list
            List<Symbol> currentSymbols = new ArrayList<>();
            // Get the feature sign
            FeatureSign current = getFeatureSignByNameSign( featureNames.get(i), signs.get(i) );
            // For all of the feature sign symbols
            for(int j = 0; j < featureSignSymbols.size(); j++) {
                // Get the current feature sign symbol
                FeatureSignSymbol featureSignSymbol = featureSignSymbols.get(j);
                // This feature sign symbol matches one of the feature signs we are looking for
                if(featureSignSymbol.getFeatureSign().equals(current)) {
                    // If i is 0, just add it to the result
                    if(i == 0) {
                        currentSymbols.add(featureSignSymbol.getSymbol());
                    }
                    // Otherwise, if the previous list of symbols has this symbol
                    // include it in the result (this is essentially getting the intersection
                    // between the previous list of symbols and the current list)
                    // We only include it if it would be in the intersection
                    else if(symbols.contains(featureSignSymbol.getSymbol())) {
                        currentSymbols.add(featureSignSymbol.getSymbol());
                    }
                }
            }
            symbols = currentSymbols;
            // For a performance boost, break if there are no symbols since there will not ever be
            if(symbols.size() == 0) {
                break;
            }
        }

        return symbols;
    }

